class MainPage(BoxLayout):
    def __init__(self, **kwargs):
        super().__init__(**kwargs)
        self.orientation = 'vertical'
        self.padding = 10
        self.spacing = 10

        # logo = kImage(source='logo.png')  # Logo resminin dosya yolunu belirtin
        # self.add_widget(logo)        

        logo = kImage(source=temp_image_path)
        self.add_widget(logo)

        button = Button(text='Bilet Olutur', background_color=(7, 0.5, 0, 1), font_size=20, bold=True)
        button.color = (0, 0, 0, 1)        
        button.bind(on_press=self.sifrecontrol)
        self.add_widget(button)

        button_2 = Button(text='Bilet Okut', background_color=(100, 204, 0, 1), font_size=20, bold=True)
        button_2.color = (0, 0, 0, 1)
        button_2.bind(on_press=self.go_to_second_page)
        self.add_widget(button_2)

    def sifrecontrol(self,text_input):
        # Create the main password input popup
            self.popup = Popup(
                title="ifre Kontrol",
                size_hint=(None, None),
                size=(400, 200),
                auto_dismiss=False  # Set to False so it won't close on its own
            )

            # Create the text input field for the password
            text_input = TextInput(
                multiline=False,
                hint_text="Ltfen ifreyi girin"
            )

            # Create the verification button
            button = Button(text="Kontrol et")
            button.bind(on_release=self.eletir)  # Bind the button to the 'eletir' method

            # Add the widgets to the popup
            self.popup.content = BoxLayout(orientation='vertical')
            self.popup.content.add_widget(Label(text="ifre"))
            self.popup.content.add_widget(text_input)
            self.popup.content.add_widget(button)

            # Open the popup
            self.popup.open()

    def eletir(self, button_instance):
            entered_password = button_instance.parent.children[1].text  # Get the text from the TextInput
            correct_password = "7139"  # Replace with your correct password

            if entered_password == correct_password:
                self.popup.dismiss()  # Close the password popup
                self.olustur_ve_kaydet()
            else:
                self.show_error_popup("Hatal ifre")

    def show_error_popup(self, error_message):
            # Create an error popup
            error_popup = Popup(
                title="ifre Hatal",
                content=Label(text=error_message),
                size_hint=(None, None),
                size=(400, 200),
                auto_dismiss=True
            )

            # Open the error popup
            error_popup.open()
            self.popup.open()
    def olustur_ve_kaydet(self):
        bilet_numarasi = random.randint(1, 10000)
        qr_text = f"{bilet_numarasi}"

        qr = qrcode.QRCode(
            version=1,
            error_correction=qrcode.constants.ERROR_CORRECT_L,
            box_size=10,
            border=4,
        )
        qr.add_data(qr_text)
        qr.make(fit=True)
        qr_img = qr.make_image(fill_color="black", back_color="white")
        qr_img.save(f"qr_code_{bilet_numarasi}.png")  # QR kodunu dosyaya kaydet
        bilet_numarasi_ekle(bilet_numarasi)

        # Bilet bilgilerini veritabanna eklemek yerine, burada kaydedebilirsiniz.

        # Pop-up olutur ve grntle
        self.popup = Popup(
            title="Bilet Oluturuldu",
            content=Label(text=f"Bilet Numaras: {bilet_numarasi}"),
            size_hint=(None, None),
            size=(400, 200),
            auto_dismiss=True  # Kullanc dar tkladnda pop-up' kapat
        )
        self.popup.open()



    def go_to_second_page(self, instance):
        app.root.current = 'second_page'

class SecondPage(BoxLayout):
    def __init__(self, **kwargs):
        super().__init__(**kwargs)
        self.orientation = 'vertical'

        self.mainpage = Button(
            text='|ANASAYFA|',
            background_color=(7, 0.5, 0, 1), font_size=20, bold=True,
            size_hint=(None, None),
            size=('100dp', '50dp'),
            pos=(0, self.height - 40)  # Position at the top-left corner
        )
        self.mainpage.color = (0, 0, 0, 1)
        
        self.mainpage.bind(on_press=self.go_to_main_page)
        self.add_widget(self.mainpage) 
        

        self.camera = Camera(resolution=(640, 480),play=True)
        
        self.add_widget(self.camera)
        
        # QR kodu tarama dmesini ekleyin
        


        self.qrbutton = Button(
            text='QR okut',
            background_color=(100, 204, 0, 1), font_size=20, bold=True,
            size_hint_y=None,
            height='48dp'
        )       
        self.qrbutton.color = (0, 0, 0, 1)
        self.qrbutton.bind(on_press=self.capture_qr)
        self.add_widget(self.qrbutton)
        

        


    def capture_qr(self, instance):
        texture = self.camera.texture
        texture.save("kamera_goruntusu.jpg")
        
        # QR kodu tara
        image = Image.open("kamera_goruntusu.jpg")
        decoded_objects = decode(image)
        
        # QR kodu bulunduysa
        if decoded_objects:
            qr_code_data = decoded_objects[0].data.decode('utf-8')
            success = self.bilet_sil(qr_code_data)  # Bilet silme ilemi
            if success:
                self.show_popup("Bilet Bulundu.")
            else:
                self.show_popup("Bilet Bulunamad.")
        else:
            self.show_popup("QR Kodu Bulunamad.")

    def bilet_sil(self, bilet_numarasi):
        try:
            conn = sqlite3.connect("bilet_veritabani.db")
            cursor = conn.cursor()

            cursor.execute("SELECT * FROM biletler WHERE numara = ?", (bilet_numarasi,))
            bilet = cursor.fetchone()

            if bilet:
                cursor.execute("DELETE FROM biletler WHERE numara = ?", (bilet_numarasi,))
                conn.commit()
                conn.close()
                return True
            else:
                conn.close()
                return False

        except Exception as e:
            print("Bilet silme ilemi srasnda bir hata olutu:", str(e))
            return False

    def show_popup(self, message):
        popup = Popup(title='Bilet Kontrol', content=Label(text=message), size_hint=(None, None), size=(400, 200))
        popup.open()
    def go_to_main_page(self, instance):
        app.root.current = 'main_page' 
class MyApp(App):
    def build(self):
        # Ekran yneticisi (ScreenManager) oluturun ve ekranlar ekleyin.
        from kivy.uix.screenmanager import ScreenManager, Screen
        sm = ScreenManager()

        main_page = Screen(name='main_page')
        main_page.add_widget(MainPage())
        sm.add_widget(main_page)

        second_page = Screen(name='second_page')
        second_page.add_widget(SecondPage())
        sm.add_widget(second_page)

        return sm

if __name__ == '__main__':
    app = MyApp()
    app.run()
